collection.ANDROID_ICS_STANDARD_SIZE = 48;

collection.ninePatchDom = function (ninePatchName, dim) {
    Dom.empty(F._target);
    var np = collection.ninePatches[ninePatchName];
    if (!np) return null;

    var specs = [];

    var sw = dim.w - np.patches[0].w - np.patches[2].w;
    var sh = dim.h - np.patches[0].h - np.patches[8].h;

    specs.push(collection._newImageForPatch(np.patches[0], 0, 0, np.patches[0].w, np.patches[0].h));
    specs.push(collection._newImageForPatch(np.patches[1], np.patches[0].w, 0, sw, np.patches[1].h));
    specs.push(collection._newImageForPatch(np.patches[2], np.patches[0].w + sw, 0, np.patches[2].w, np.patches[2].h));

    specs.push(collection._newImageForPatch(np.patches[3], 0, np.patches[0].h, np.patches[3].w, sh));
    specs.push(collection._newImageForPatch(np.patches[4], np.patches[0].w, np.patches[0].h, sw, sh));
    specs.push(collection._newImageForPatch(np.patches[5], np.patches[0].w + sw, np.patches[0].h, np.patches[5].w, sh));

    specs.push(collection._newImageForPatch(np.patches[6], 0, np.patches[0].h + sh, np.patches[6].w, np.patches[6].h));
    specs.push(collection._newImageForPatch(np.patches[7], np.patches[6].w, np.patches[0].h + sh, sw, np.patches[7].h));
    specs.push(collection._newImageForPatch(np.patches[8], np.patches[0].w + sw, np.patches[0].h + sh, np.patches[8].w, np.patches[8].h));

    return Dom.newDOMFragment(specs);
};
collection._newImageForPatch = function (patch, x, y, w, h) {
    return {
        _name: "image",
        _uri: PencilNamespaces.svg,
        x: x,
        y: y,
        width: w,
        height: h,
        preserveAspectRatio: "none",
        //transform: "translate(" + x + ", " + y + ") scale(" + (w / patch.w) + ", " + (h / patch.h) + ")",
        "xlink:href": patch.url
    }
};
collection.ninePatchBound = function (ninePatchName, dim) {
    var np = collection.ninePatches[ninePatchName];
    return new Bound(np.p1.x, np.p1.y, dim.w - np.p1.x - np.p2.x, dim.h - np.p1.y - np.p2.y);
}

collection.nPatchDom = function (nPatchName, dim) {
    var np = collection.nPatches[nPatchName];
    var n = np.patches.length;
    if (n == 0) return null;
    var m = np.patches[0].length;

    var specs = [];
    var totalFlexW = 0;
    var totalFlexH = 0;
    for (var j = 0; j < m; j ++) {
        var p = np.patches[0][j];
        if (p.scaleX) totalFlexW += p.w;
    }
    for (var i = 0; i < n; i ++) {
        var p = np.patches[i][0];
        if (p.scaleY) totalFlexH += p.h;
    }

    var targetScaleX = dim.w - (np.w - totalFlexW);
    var targetScaleY = dim.h - (np.h - totalFlexH);
    var rX = targetScaleX / totalFlexW;
    var rY = targetScaleY / totalFlexH;

    var x = 0;
    var y = 0;
    var accumulatedScaleW = 0;
    var accumulatedScaleH = 0;
    for (var i = 0; i < n; i ++) {
        x = 0;
        accumulatedScaleW = 0;
        var lastH = 0;
        var scaledY = false;
        for (var j = 0; j < m; j ++) {
            var p = np.patches[i][j];

            var w = p.w;
            var h = p.h;

            if (p.scaleX) {
                w = (j == np.lastScaleX) ? targetScaleX - accumulatedScaleW : Math.floor(p.w * rX);
                accumulatedScaleW += w;
            }
            if (p.scaleY) {
                h = (i == np.lastScaleY) ? targetScaleY - accumulatedScaleH : Math.floor(p.h * rY);
                scaledY = true;
            }

            specs.push(collection._newImageForPatch(p, x, y, w, h));

            x += w;
            lastH = h;
        }
        y += lastH;
        if (scaledY) accumulatedScaleH += lastH;
    }

    return Dom.newDOMFragment(specs);
};
collection.nPatchBound = function (nPatchName, dim) {
    var np = collection.nPatches[nPatchName];
    return new Bound(np.p1.x, np.p1.y, dim.w - np.p1.x - (np.w - np.p2.x), dim.h - np.p1.y - (np.h - np.p2.y));
}

collection.getScaleRatio = function () {
    //var scale = collection.properties.scale.value;
    //if (scale == "small") return 30 / 48;
    //if (scale == "normal") return 36 / 48;
    return 1;
};
collection.getBaseSize = function () {
    return collection.getScaleRatio() * collection.ANDROID_ICS_STANDARD_SIZE;
};

collection.getThemeAwareColor = function (shapeColor, shapeTheme, type, disabled) {
    var currentThemeColor = collection.properties.defaultColorTheme.value.value == 'dark' ?
                                collection.properties["defaultDark" + type + "Color"].value : 
                                    collection.properties["defaultLight" + type + "Color"].value;
    var color = shapeColor;
    if (shapeColor.toString() == currentThemeColor.toString()) {
        color = shapeTheme.value == 'dark' ? 
                collection.properties["defaultDark" + type + "Color"].value : 
                collection.properties["defaultLight" + type + "Color"].value;
    }

    if (disabled.value) color = color.hollowed(0.7);

    return color;
};
collection.getWrappedTextTransform = function (x, centerY, name, font) {
    return [translate(x, (font.getPixelHeight() * 5 / 6) + centerY - F.textSize(name).h / 2)];
};

